import './App.css';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom"
import Login from './components/login';
import Profile from "./components/profile";

function App() {
  return (
    <div className="Container">
        <Router>
            <Switch>
                <Route path="/login">
                    <Login/>
                </Route>
                <Route path="/profile">
                    <Profile/>
                </Route>
            </Switch>
        </Router>
    </div>
  );
}

export default App;
